import { Bar } from "react-chart.js";
import Chart from "chart.js";
import "./IncExpChart.css";

const IncExpChart = () => {
  return (
    <div className="chart">
      <Bar data={{ labels: ["Red", "Green"] }} width={300} height={200} />
    </div>
  );
};
export default IncExpChart;
